    #[test]
    fn test_p2tr_script_spend_inscription() {
        let secp = secp256k1::Secp256k1::new();
        let bitcoin_tx: Transaction = bitcoin::consensus::deserialize(&hex::decode("").unwrap()).unwrap();
        let prevout: TxOut = bitcoin::consensus::deserialize(
            &hex::decode("2c02000000000000225120ffc091e94d81dd85ac3531fb6ec5dde901ff867cb4b9690484e777a714102c45").unwrap(),
        )
        .unwrap();
        println!("Txid: {:?}", bitcoin_tx.compute_txid());
        let input_idx = 0;

        let prevouts = vec![prevout.clone()];

        let mut witness_part = bitcoin_tx.input[input_idx]
            .witness
            .iter()
            .map(|w| w.to_vec())
            .collect::<Vec<_>>();

        let control_block_part = witness_part.pop().unwrap();

        let control_block = ControlBlock::decode(&control_block_part).unwrap();

        let output_xonly_pubkey: secp256k1::XOnlyPublicKey =
            XOnlyPublicKey::from_slice(&prevout.script_pubkey.as_bytes()[2..34]).unwrap();

        let unlock_script_part = witness_part.pop().unwrap();

        let unlock_script = ScriptBuf::from_bytes(unlock_script_part);
        let unlock_script_leafhash =
            TapLeafHash::from_script(&unlock_script, LeafVersion::TapScript);

        let res =
            control_block.verify_taproot_commitment(&secp, output_xonly_pubkey, &unlock_script);

        assert!(res);

        let mut exec = Exec::new(
            ExecCtx::TaprootScriptSpend,
            OPTIONS,
            TxTemplate {
                tx: bitcoin_tx.clone(),
                prevouts: prevouts.clone(),
                input_idx,
                taproot_script_leafhash: Some(unlock_script_leafhash),
            },
            unlock_script,
            witness_part,
        )
        .unwrap();
        loop {
            if exec.exec_next().is_err() {
                break;
            }
        }
        if !exec.result().unwrap().success {
            println!(
                "[ERROR] Script execution failed - Input index: {}",
                input_idx
            );
            panic!("Script execution failed, details: {:?}", exec.result());
        }
    }

